alidPassword123| Username is required    |\r\n#      | validuser@example.com  | \"\"              | Password is required    |\r\n#\r\n#  @boundary @android @ios\r\n#  Scenario: Login with empty fields\r\n#    When the user clears all input fields\r\n#    Then the login button should be \"disabled\"\r\n#\r\n#  @functional @android @ios\r\n#  Scenario: Forgot password functionality\r\n#    When the user clicks forgot password link\r\n#    Then the user should be navigated to forgot password screen\r\n#\r\n#  @security @android @ios\r\n#  Scenario: Login with SQL injection attempt\r\n#    When the user enters username \"admin'; DROP TABLE users; --\"\r\n#    And the user enters password \"password\"\r\n#    And the user clicks the login button\r\n#    Then the user should see an error message \"Invalid credentials\"\r\n#\r\n#  @performance @android @ios\r\n#  Scenario: Multiple login attempts\r\n#    When the user performs login with username \"validuser@example.com\" and password \"wrongpassword\"\r\n#    Then the user should see an error message \"Invalid credentials\"\r\n#    When the user clears all input fields\r\n#    And the user performs login with username \"validuser@example.com\" and password \"ValidPassword123\"\r\n#    Then the user should be logged in successfully","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Nikhil%20Raj/oliveMobileApp/src/test/resources/features/Login.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@login","id":"b115429b-5ea4-423c-88c3-8b4268e57074"},{"location":{"line":1,"column":8},"name":"@regression","id":"977fcc1e-f912-483c-bf99-ed60ea5f8256"}],"language":"en","keyword":"Feature","name":"Login Functionality","description":"  As a user of the mobile application\n  I want to be able to login with valid credentials\n  So that I can access the application features","children":[{"background":{"location":{"line":7,"column":3},"keyword":"Ba
